import React, { Component } from "react";

class Dashboard extends Component {
  render() {
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh",
          width: "100vw",
          fontWeight: "bold",
          fontSize: "4vw",
          fontFamily: "BlinkMacSystemFont"
        }}
      >
        Dashboard
      </div>
    );
  }
}

export default Dashboard;
